INSERT INTO `ushop_eye_info` (`id`, `num_R`, `num_L`, `num_RS`, `num_LS`, `degrees`, `date`, `m_date`, `advice`, `user_id`, `is_del`)
VALUES
	(1,'0.51','0.51','2.00','-1.00',500,'2000-06-01 11:07:26','2018-06-07 19:55:11','眼睛是心灵的窗户，所以我们要爱惜自己的眼睛，平时要加以保护和不要太疲劳，更要保持清洁，注意休息\r\n',1,0),
	(2,'0.2','0.2','2.10','-1.10',500,'2018-05-26 17:30:21','2018-06-04 20:58:44','如果眼睛出现不适建议及时就医，不要用手揉眼睛，眼睛疾病的表现形式一开始可能就是眼干，眼涩，流眼泪等状况。',2,0),
	(3,'1.5','1.5','1.00','-2.00',300,'2000-06-01 11:07:26','2018-06-04 20:58:44','8发生在玻璃体的主要是玻璃体浑浊9发生在视网膜的疾病主要有视网膜出血渗出黄斑变性视网膜炎等10视神经会发生视神经炎视神经萎缩等11眼部常见的肿瘤有眼睑鳞状细胞癌视网膜母细胞瘤以及球后占位性瘤12还有就是屈光不正即近视远视散光还有无法纠正的弱视13根据色异常可分色弱红色盲绿色盲全色盲14最后还有青光眼\n      以上是对“眼睛疾病都有哪些?”这个问题的建议，希望对您有帮助，祝您健康',3,0),
	(4,'2.5','2.5','0.00','-1.00',450,'2000-06-01 11:07:26','2018-06-04 20:58:44','一般眼睛有问题会出现视力下降，眼睛胀痛，畏光流泪，有分泌物增多等等，建议具体情况到医院就诊检查',4,0),
	(5,'3.5','3.5','3.00','-1.00',300,'2000-06-01 11:07:26','2018-06-04 20:58:44','',5,0),
