INSERT INTO `ushop_topic` (`id`, `store_id`, `title`, `sub_title`, `cover_pic`, `content`, `read_count`, `virtual_read_count`, `layout`, `sort`, `agree_count`, `virtual_agree_count`, `virtual_favorite_count`, `addtime`, `is_delete`)
VALUES
	(1,1,'刹车失灵怎么办？牢记这6招关键时刻能保命','','https://p3.pstatp.com/large/pgc-image/1518158557275f2954c7788','<p><br/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">刹车系统是一辆汽车至关重要的系统，决定着人们开车的安全性。刹车一旦损害，出现刹车失灵等状况，车主发生车祸的几率会直线上升，很多大型事故都是由于刹车失灵导致的。那么，如果刹车失灵了，各位车主应该怎么做呢？下面编辑给大家推荐几招，学会了可以保命哦~当然也希望大家永远不会遇到刹车失灵的情况！</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"https://p3.pstatp.com/large/pgc-image/1518158557275f2954c7788\" alt=\"刹车失灵怎么办？牢记这6招关键时刻能保命\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">第一步，调整心态，沉着应对。</span><br/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">当发现刹车系统失灵时，千万不能慌乱，因为一旦慌乱就容易出错，再把刹车当油门踩，只会雪上加霜让情况变得更糟糕。所以一定要沉着冷静，调整好心态，既然已经发生了，就要想办法自救，把损失降到最小。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">第二步，打开应急灯，提醒周围车辆。</span></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">在刹车失灵的紧急状况下，很多司机都只想着如何让车辆减速，而忽视了对周围车辆的提醒。这样做并不能说不对，但如果在采取减速措施的同时，通过打开双闪和鸣笛来引起周围行驶车辆的注意，会让自救的成功率变得更高。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">第三步，多踩几次刹车踏板，增加制动力恢复的机会。</span></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">当发现刹车踏板失效时，要下意识地多次松开再踩下刹车踏板，这样会对油管内有空气的制动系统施加压力，通过多次的施压，可以增加制动力恢复的机会（一般第二或第三脚可以恢复刹车力）。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"https://p3.pstatp.com/large/pgc-image/1518158557283048fc35be9\" alt=\"刹车失灵怎么办？牢记这6招关键时刻能保命\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">第四步，拉手刹减速。</span></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">当制动力依旧不能恢复时，就需要通过拉手刹来减慢车速。拉手刹时必须切记两点：</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">1、手刹不能一下拉到底或者拉的过快。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">因为车速、惯性等原因，一旦把手刹拉的过快、过死，就会造成钢丝绳蹦断，手刹也就彻底失效了。所以应当缓缓用力，慢慢将手刹拉到底。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">2、拉手刹时，尽量不要猛打方向，否则后轮本身已经被抱死，很容易发生侧滑甚至翻车现象。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">对于采用电子驻车（电子手刹）的一些中高级车型来说，一旦刹车失灵，通过拉起手刹按键将车辆减速的成功率会更高。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">因为目前诸如大众、雪佛兰、别克等一些主流品牌车辆的电子手刹除了具备本身的驻车功能外，还具备紧急刹车功能。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">在车速超过7km/h时，拉起电子手刹按键，此时车子会通过ESP控制单元以近乎全力的刹车力道对四个车轮进行液压制动，以保证车辆能在刹车系统失效的情况下紧急刹停。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"https://p3.pstatp.com/large/pgc-image/1518158557379e89e269c03\" alt=\"刹车失灵怎么办？牢记这6招关键时刻能保命\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">第五步，强制降档减速。</span></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">对于手动挡车型来说，如果拉手刹减速缓慢或者手刹失效，就要通过强制降档，以发动机制动来拖慢车速。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">如果车速较快，变速箱此时已经很难开合，大多抢不进低档位，所以正确的操作是给一大脚油门，轰开同步器，强行推进低档位，再轰一脚油门，进档。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">不过强制降档减速很容易使发动机转速飙升到超过转速极限值，会对发动机本身造成不小的伤害。但本着生命价值高于一切的原则，即使会让发动机受损，在紧急时刻也一定要果断操作。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">第六步，摩擦障碍物减慢车速。</span></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">当发现车辆前方有致命阻挡物无法避让时，我们需要以最短的时间让车辆尽快停下来。这时，再通过降档减速的方法可能就来不及了，我们可以直接通过摩擦道路两旁的山体、栏杆、树木或建筑等障碍物让车辆尽快停下来。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">要靠一点，打回来一点，再向障碍物靠一把，再打回来一把。</p>',5,16,0,1000,0,0,2,1520521156,1),
	(2,1,'这些奇葩的汽车logo都是什么鬼！','','https://p3.pstatp.com/large/65c10012968b76cf9609','<p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">车标，是辨识汽车品牌的重要标志。现如今，市场上出现的汽车品牌多到让人眼花缭乱。车标种类之多更是让人认不全。认不全也就算了，起码也得有点辨识度吧？连最起码的辨识度都弄得这么不清不楚，让那些汽车小白们怎么办！</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">不信，你看看下面这几个车标，这是要闹哪样？（本文充满知识点，请准备好小笔记）</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">同样系列之一，都是小翅膀</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">都要模仿了，为啥就不能高大上一点呢？</p><p><img src=\"https://p3.pstatp.com/large/65c10012968b76cf9609\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">宾利标志的设计用简洁圆滑的线条勾勒形成一对飞翔的翅膀，像一只展翅高飞的雄鹰。翅膀中的字母“B”则为宾利汽车创始人Bentley名字的首字母。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">瑞麒，奇瑞旗下的高端轿车品牌，不过现在已经停产了。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">同样系列之二，都是小星星</p><p><img src=\"https://p3.pstatp.com/large/65c10012968cc2cf09d5\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">江淮的标志代表着，柔和与刚毅兼具，稳重而极具张力，充分辉映着“制造更好的产 品，创造更美好的社会”的江淮汽车的企业愿景！</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">下面的是克莱斯勒曾于1957-1995年使用过著名的五角星式标志，1995年以后换用了新的车标。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">同样系列之三，都是公牛</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">一头向右，一头向左，一眼望去，唯一的区别就是在底色上了…</p><p><img src=\"https://p9.pstatp.com/large/65c2000922f4c656d452\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">兰博基尼的标志是一头充满力量的、正向对方攻击的斗牛，与大马力高性能的跑车特性相符，同时也代表了创始人像斗牛般不甘示弱的个性。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">长安金牛星的标志奋进的公牛，寓意着“力量、进取、勤劳、可靠、勇于挑战、吉祥”。而红色则代表了激情与斗志。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">同样系列之四，都是马</p><p><img src=\"https://p3.pstatp.com/large/65c10012968d623ec885\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">法拉利的这个标志有个感人的故事，该标志起初是作为个人徽章，由备受重勋的意大利一战飞行员空军烈士弗朗西斯科·巴拉卡（Francesco Baracca）使用，他把徽章绘在了所驾驶飞机的机身上。1923年，恩佐·法拉利在一场赛车比赛中遇到了那个弗朗西斯科的母亲，这位母亲对自己儿子的英勇战绩非常自豪，她于是提出让恩佐·法拉利把他儿子战机上的跃马标志印在座驾上。除了熟悉的跃马之外，法拉利的盾牌还包含其它元素。黄色底色取自于摩德纳的金丝雀，以纪念恩佐·法拉利的故乡；而上方的绿、白、红三种颜色则代表意大利国旗。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">保时捷标志的设计又有一段不可不说的故事了，首选要从保时捷的发源地符腾堡斯图加特说起，在罗马帝国时期，符腾堡被要求设计出自己的专属盾徽用于规范管理自己的居民，当时的居民就提议，既然咱们这野生动物多，贵族们又爱打鹿，索性就以鹿角为基础来设计吧，于是有了最早的盾徽。15世纪，受欧洲教廷主义影响，全欧洲的盾徽设计都是怎么复杂怎么来，那时还出现了一个设计理念，把盾徽分成四个小块，于是在1945年符腾堡的盾徽得以改进，分成了四个小块，也就为之后的保时捷车标打下了坚定的基础。后来的后来魏玛共和国成立了，新旧交替，又需要设计新的盾徽，于是这次他们就加入了黑红黄三种颜色，还加了两只鹿进去，这会这个盾徽就很像保时捷的标志了有没有！这时费迪南德·保时捷老爷子要成立自己的汽车公司，但是奈何人手不够，又没钱，于是就直接把符腾堡盾徽拿来用了。又过了很久，老爷子认识到车标的重要性，于是请来了他的老同事，大众汽车的标识设计者弗朗兹·克萨韦尔·莱姆斯来设计保时捷徽标。老爷子认为老是用符腾堡的盾徽来做自己的车标有点抄袭的意思，后来他发现斯图加特的徽标是一匹马，而斯图加特又是保时捷的总部，骏马奔跑的样子，这不跟汽车和切合吗？再结合符腾堡的盾徽，于是乎就有了保时捷的标志……话说，这不还是抄袭嘛啊喂！</p><p><img src=\"https://p9.pstatp.com/large/65c000129ed7d3f1d15d\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">符腾堡曾经盾徽</span></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">宝骏标志的设计理念是啥？有人知道么？</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">这一凹一凸的logo，是有什么深刻的含义么</p><p><img src=\"https://p1.pstatp.com/large/65bf0012c3a9a4ecc432\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">华泰车标图案内部是造型方正的U，外部以椭圆环抱，形成外圆内方的造型，表达了华泰汽车“天人合一”的环保理念，外圆强调与大自然的和谐相处，内方则体现华泰汽车以保护环境为己任。专注于清洁能源动力的开发。U的中文谐音为优。即优秀之意，象征华泰汽车：前沿的理念，精湛的技术，一流的品质。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">长城标志设计的椭圆外形寓意： 立足世界 走向中国；烽火台形象寓意：中国传统文化象征；剑锋箭头寓意： 充满活力 蒸蒸日上；敢于亮剑 无坚不摧；立体“1”：快速反应 永争第一</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">北汽logo在经历“猪鼻子”前，是不是有点像中年发福版奔驰logo？</p><p><img src=\"https://p9.pstatp.com/large/65c40008b0b7d2db0b01\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">奔驰的标志最初是Benz外加麦穗环绕。1926年，戴姆勒与奔驰合并，星形的标志与奔驰的麦穗终于合二为一，下有Mercedes-Benz字样，后将麦穗改成圆环，并去掉了Mercedes-Benz的字样。而随着这两家历史最悠久的汽车生产商的合并，厂方再次为商标申请专利权，而此圆环中的星形标志演变成今天的图案，一直沿用至今，并成为世界十大著名的商标之一。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">关于北汽标志的含义fanfan没找到，但可以普及个关于这个车标的另一个小知识，北汽的这个logo现在仅在还在生产的北汽越野车212上使用。</p><p><img src=\"https://p1.pstatp.com/large/65bb0010f92be30b5d06\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">聊完了上面那些容易让人混淆的logo，咱们再来聊点好玩的！每个车主在拿到车的时候，是不是都想给车增加点什么小装饰呢？从内饰到外观，能动手的地方估计都不会放过，这不，连汽车logo都没能“幸免”……</p><p><img src=\"https://p3.pstatp.com/large/65c3000916be6e0ffdb5\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p3.pstatp.com/large/65c3000916bfa7037d47\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p9.pstatp.com/large/65c2000922f5c615d982\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p3.pstatp.com/large/65c3000916c09afcd274\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p3.pstatp.com/large/65c3000916c187053c04\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p9.pstatp.com/large/65c40008b0b835734f9b\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p9.pstatp.com/large/65c10012968e12681a44\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p1.pstatp.com/large/65c5000734b7c13712b1\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p3.pstatp.com/large/65c000129ed837164fdb\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p9.pstatp.com/large/65c2000922f603fdd48f\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p3.pstatp.com/large/65c40008b0b9a2cea262\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p3.pstatp.com/large/65bf0012c3aa76ee2c2d\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p1.pstatp.com/large/65c40008b0ba3d73f470\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p3.pstatp.com/large/65c100129690e69209a4\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p3.pstatp.com/large/65c2000922f78aec31b9\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/><img src=\"https://p9.pstatp.com/large/65c40008b0bba1a97543\" alt=\"这些奇葩的汽车logo都是什么鬼！\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">最后的最后，fanfan想跟大家严肃的说一件事情，不要随意更改汽车上的logo哦（比如之前看新闻报道有众泰车主为了面子，把自己的车标生生改成了保时捷），这种更改是违法的哟！详见下方：</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">车标(商标)是车辆品牌的标志，具有法律效力。更改车标，意味着更改品牌型号。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">而《机动车登记规定》中规定：</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">第十五条 有下列情形之一的，不予办理变更登记：</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">（一）改变机动车的品牌、型号和发动机型号的，但经国务院机动车产品主管部门许可选装的发动机除外；</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">《道路交通安全法》中规定：</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">第十六条 任何单位或者个人不得有下列行为：</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">(一)拼装机动车或者擅自改变机动车已登记的结构、构造或者特征;</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">(二)改变机动车型号、发动机号、车架号或者车辆识别代号;</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">私自更换车标，违反《机动车登记规定》，开着换了车标的车上路，违反《道路交通安全法》</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">引用于知乎作者：西直门大官人</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">而且不仅违法交通法，可能还会涉及违反商标法哦！</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">《商标法》五十七条规定，有下列之一行为均属侵权：</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">(一)未经商标注册人的许可，在同一种商品上使用与其注册商标相同的商标的；</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">(二)未经商标注册人的许可，在同一种商品上使用与其注册商标近似的商标，或者在类似商品上使用与其注册商标相同或者近似的商标，容易导致混淆的；</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">(五)未经商标注册人同意，更换其注册商标并将该更换商标的商品又投入市场的。</p><p><br/></p>',5,0,0,1000,0,0,0,1520521208,1),
	(3,1,'优商城【招商信息公示】','','https://static.ushop.xany6.com/uploads/image/2c/2c142e3238b4829fc847360cca74d324.png','<p style=\"text-align: center; line-height: 1.5em;\"><span style=\"font-size: 24px;\">第三方商家入驻合作</span></p><p style=\"line-height: 1.5em;\">&nbsp;　</p><p style=\"line-height: 1.5em;\">尊敬的各位经营者，欢迎您合作优商城！</p><p style=\"line-height: 1.5em;\">资质要求方面，遇到任何不清楚的细节，请联系下方招商团队确认。</p><p style=\"line-height: 1.5em;\">目前要求公公司注册资金50万，公司经营范围包括了汽车用品、配件、或服务等相关范围。</p><p style=\"line-height: 1.5em;\">如果商标为“注册申请受理”状态（即“TM”商标），申请时间需已满6个月以上。</p><p style=\"line-height: 1.5em;\">总的招商资质原则是：合法、合理、合规，请商家严谨、完整、诚信的提交相关信息。</p><p style=\"line-height: 1.5em;\">&nbsp;&nbsp;　</p><p style=\"line-height: 1.5em;\">&nbsp;　</p><p style=\"text-align: center; line-height: 1.5em;\"><span style=\"font-size: 24px;\">线下服务门店合作</span></p><p style=\"line-height: 1.5em;\">&nbsp;&nbsp;　</p><p style=\"line-height: 1.5em;\">只要您的门店拥有两个及以上的独立施工工位，有合法的汽车服务业营业手续，我们都真诚欢迎您与我们建立合作。如果您有合作意愿，请您将门店的照片，地址信息及门店负责人联系方式通过电子邮件发送至ushop@itee.cc，稍后我们有专人和您联系。</p><p style=\"line-height: 1.5em;\">&nbsp;　</p><p style=\"line-height: 1.5em;\">&nbsp;　</p><p style=\"text-align: center; line-height: 1.5em;\"><span style=\"font-size: 24px;\">请注意以下要求细节</span></p><p style=\"line-height: 1.5em;\">&nbsp;&nbsp;　</p><p style=\"line-height: 1.5em;\">以下产品需要提供国家强制性产品认证证书 ( CCC认证 )</p><p style=\"line-height: 1.5em;\">安全座椅、大灯总成、轮胎、便携式内置电池供电的导航和记录仪（外接电源线的提供质检报告即可）</p><p><br/></p><p style=\"line-height: 1.5em;\">蓄电池需要提供全国工业许可证+质检检疫检验报告</p><p><br/></p><p style=\"line-height: 1.5em;\">需要依据品牌提供质检报告的产品：</p><p style=\"line-height: 1.5em;\">GPS导航、行车记录仪、安全预警仪、洗车工具 （ 洗车机、洗车水枪）、空气净化</p><p><br/></p><p style=\"line-height: 1.5em;\">经营机油类目品牌（ 除美孚、壳牌和嘉实多以外的品牌）务必是品牌方直接授权或者国内总代直接授权</p><p><br/></p><p style=\"line-height: 1.5em;\">机油类目美孚、壳牌和嘉实多三大品牌授权链条限定于两级以内 （如品牌方---代理方---商家），需要提供三个月内的</p><p style=\"line-height: 1.5em;\">每一级进货发票，质保金调整为20万/50万，三大品牌一级代理商质保金为20万，二级代理商质保金为50万</p><p><br/></p>',15,0,1,500,0,0,0,1520521451,1);
